import { mapState, mapActions } from 'pinia'
import data from '../stores/abc'
import { isPlainObject } from '@vue/shared'
export default {
    data() {
        return {
            objs1: [],
            placeInfo: [],
            // 這個不需要更動應該沒問題
            value: 0,
            placeInfo1: []


        }
    },
    computed: {
        ...mapState(data, ["objs", "x",]),

    },
    methods: {
        ...mapActions(data, ["getSport", 'ck','setWhite']),
        // 這裡改成你要抓的那筆資料方法，比如說public就是"getpublic"，ck必須要抓，是滑鼠點擊的方法
        get() {
            // 這裡記得要改成你要抓的那筆資料
            this.getSport()
            console.log(this.objs)
            // console.log(this.objs[0])
        },
        // dd(){
        //     console.log(this.d);
        //         this.d.forEach(item => {
        //             console.log(item);
        //             place.innerHTML += `<option value=${item}> ${item} </option>\n`
        // })

        // },
        test() {
            // this.value = 1
            //地址
            let adress = document.getElementById("adress")
            //區域
            let area = document.getElementById("area")
            //體育館名稱
            let names = document.getElementById("names")
            //介紹
            let introduce = document.getElementById("introduce")
            //交通方式
            let howtogo = document.getElementById("howtogo")
            //插入式圖片
            let img = document.getElementById("img")
            //下拉式選單
            let place = document.getElementById("place")
            //體育館內容的陣列
            this.placeInfo = []
            //體育館名稱陣列
            this.sportName = []

                // adress.innerText = "體育館地址: " 
                // names.innerText = "體育館名稱: " 
                // howtogo.innerText = "電車交通: "
                // introduce.innerText = "介紹: " 
                // img.innerHTML = ""





            setTimeout(() => {
                for (let i = 0; i < this.objs.length; i++) {
                    let a = this.objs[i].location
                    // console.log(a);
                    if (a == this.x) {
                        this.placeInfo.push(this.objs[i])
                        console.log(this.placeInfo);
                    }
                    if (a == this.x) {
                        this.sportName.push(this.objs[i].name)
                        console.log(this.sportName);
                    }
                }
            }, 500)


            setTimeout(() => {
                //place.innerHTML = "`<option value=${item}> 請選擇 </option>\n`";
                place.innerHTML = ""
                this.sportName.forEach(item => {
                    console.log(item);
                    place.innerHTML += `<option value=${item}> ${item} </option>\n`
                });



                adress.innerText = "體育館地址: " + this.placeInfo[0].locationarea
                names.innerText = "體育館名稱: " + this.placeInfo[0].name
                howtogo.innerText = "電車交通: " + this.placeInfo[0].howtogo
                introduce.innerText = "介紹: " + this.placeInfo[0].introduce
                img.innerHTML = '<img src="' + this.placeInfo[0].img + ' " alt="" style="width: 500px; height: 400px;  " >'
                // console.log(this.placeInfo)
                // console.log(place)
                // console.log(this.sportName);


                place.addEventListener("change", () => {
                    this.placeInfo1 = [];
                    console.log(place.value)
                    this.placeInfo.forEach(item => {
                        if (place.value == item.name) {
                            this.placeInfo1 = item;
                        }
                    })
                    console.log(this.placeInfo1);
                    console.log(this.placeInfo1.locationarea);
                    adress.innerText = "體育館地址: " + this.placeInfo1.locationarea
                    names.innerText = "體育館名稱: " + this.placeInfo1.name
                    howtogo.innerText = "電車交通: " + this.placeInfo1.howtogo
                    introduce.innerText = "介紹: " + this.placeInfo1.introduce
                    img.innerHTML = '<img src="' + this.placeInfo1.img + ' " alt="" style="width: 500px; height: 400px;  " >'
                })

                // adress.innerText = "體育館地址: " + this.placeInfo1.locationarea
                // names.innerText = "體育館名稱: " + this.placeInfo1.name
                // howtogo.innerText = "電車交通: " + this.placeInfo1.howtogo
                // introduce.innerText = "介紹: " + this.placeInfo1.introduce
                // img.innerHTML = '<img src="' + this.placeInfo1.img + '" >'
            }, 800)

            setTimeout(() => {
                // let insertedImage = img.querySelector('img'); insertedImage.width = 500; insertedImage.height = 300; insertedImage.style.textAlign = 'center'; insertedImage.style.verticalAlign = 'middle'
                area.innerText = this.x;
            }, 900)
        },
    },
    mounted() {
        this.get()
